    <div className={`frame-2501 border-1px-black ${className || ""}`}>
      <div className="your-business-goals2 valign-text-middle ibmplexsans-normal-quarter-spanish-white-16px">
        {yourBusinessGoals}
      </div>
    </div>
  );
}

export default Frame2501;
